$_MODULE['<{shoppingfeed}prestashop>faq_a2d7e938e7cd05b7ebd64ebad22814cc'] = 'Le module Shoppingfeed Prestashop Plugin (Feed&Order) est-il compatible avec le module Shopping Feed Officiel ?';
$_MODULE['<{shoppingfeed}prestashop>faq_89acc09a0607dd7250a95a1c3930334c'] = 'Non. Ce nouveau module remplace l\'ancien. Toutes les fonctionnalités sont présentes dans ce module : votre flux produits, la mise à jour du stock et des prix en 15 minutes ou l\'import de vos commandes sur les marketplaces.';
$_MODULE['<{shoppingfeed}prestashop>faq_8a217e367c53696764e483feb808bd75'] = 'Comment fonctionne Shoppingfeed Prestashop Plugin (Feed&Order) ?';
$_MODULE['<{shoppingfeed}prestashop>faq_65f96964490550f0a7f98d19d3311e7f'] = 'Le module a deux modes :';
$_MODULE['<{shoppingfeed}prestashop>faq_3d842adc730d1fae32fa9455563cea9b'] = 'le mode « synchronisation temps réel », dans ce cas à chaque mise à jour du stock d’un produit par exemple si vous modifiez manuellement ou si une commande passe dans le statut qui déstocke, le module enverra l’information à Shopping Feed qui mettra à jour les marketplaces. Mais certains marchand qui gère de nombreuses commandes et de nombreux produits ne peuvent pas multiplier les appels sur l’API Shopping Feed.';
$_MODULE['<{shoppingfeed}prestashop>faq_4e1c9cfac38f33530cd82cf869c19312'] = 'le mode « synchronisation par tâche cron », dans ce cas la mise à jour de stock est mis en file d’attente et vous devez programmer un cron pour exécuter cette tâche qui peut être longue. Les mises à jour de stocks sont alors regroupés pour de meilleures performances.';
$_MODULE['<{shoppingfeed}prestashop>faq_f1c390ab471fb464d4d0ceaf36d2a51b'] = 'Quels sont les recommendation pour la configuration du paramètre temps-réel ?';
$_MODULE['<{shoppingfeed}prestashop>faq_93b89e30826e066b96bfba5adc13c4a1'] = 'Vous avez activé le multishop et disposez de plusieurs comptes Shopping Feed ? Le paramètre temps réél à OUI est conseillé.';
$_MODULE['<{shoppingfeed}prestashop>faq_ab172765a622443a20f2c18f06b6fb05'] = 'Vous avez moins de 100 produits ? Le paramètre temps réél à OUI est conseillé. Vous disposez de peu de stock de chaque référence et pour vous la disponibilité au plus juste est primordiale. De plus aucune tâche  cron à configurer n’est nécessaire. L’envoi des mises à jour de stocks en temps réel à l’API de Shopping flux vous garanti  une synchronisation des stocks en moins de 15 min. Cependant, cela multiplie les appels à l’API Shopping flux ce qui peut ralentir  le temps de chargement les pages qui décrémentent ou incrémentent du stock, notamment lors de la mise à jour du statut des commandes.';
$_MODULE['<{shoppingfeed}prestashop>faq_6a20984e21f5f88f29df12b2d33429b2'] = 'Vous avez entre 100 et 1000 produits ? Le paramètre temps réél à NON reste conseillé. Les mises à jour sont mis en file d’attente et la configuration d’une tâche cron (URL) toutes les 5 minutes  permettra de synchroniser tous les produits en attente de synchronisation. Cela optimise les appels à l’API  Shopping Flux et les performances de chargement des pages.';
$_MODULE['<{shoppingfeed}prestashop>faq_b64313787f100e22dda1770ce3a4cae2'] = 'Vous avez plus de 1 000 produits ? Le paramètre temps réél à NON est indispensable. Vous utilisez probablement un outil externe (type ERP) pour gérer vos stocks ce qui peut engendrer de nombreuses mises à jour en parallèle.  Dans ce cas, les mises à jour sont mis en file d’attente et la configuration d’une tâche cron (URL) toutes les 5 minutes   permettra de synchroniser tous les produits en attente de synchronisation. Cela optimise les appels à l’API Shopping   Flux et les performances de chargement des pages.';
$_MODULE['<{shoppingfeed}prestashop>faq_78e9842984cf37578294abb7548aff4f'] = 'Est-ce que le module Shoppingfeed Prestashop Plugin (Feed&Order) synchronise d\'autres données présent sur la liste de produits ?';
$_MODULE['<{shoppingfeed}prestashop>faq_c946682e483134075cbe6980445076a3'] = 'Oui. Votre stock et vos prix sont synchronisés toutes les 15 minutes. Mais votre flux catalogue est visité chaque jour.';
$_MODULE['<{shoppingfeed}prestashop>faq_343e585ee8725c27810936e71e12c051'] = 'Est-ce que je peux gérer les transporteurs sur les marketplaces ?';
$_MODULE['<{shoppingfeed}prestashop>faq_63bf47dd06660ad4ead84830153cc57f'] = 'Oui. Vous pouvez associer les transporteurs des marketplaces avec ceux de PrestaShop. Veuillez noter qu\'une première commande doit être importée dans votre PrestaShop avant de voir le transporteur d\'une marketplace. Après cela, vous pouvez vous rendre dans le menu Paramètres > Flux des commandes pour configurer vos commandes.';
$_MODULE['<{shoppingfeed}prestashop>faq_d931176dae7f44deca40b4cf854f1fa6'] = 'Est-ce que je peux gérer l\'ISBN, l\'EAN13, le MPN ou ma propre référence pour mon flux produit ?';
$_MODULE['<{shoppingfeed}prestashop>faq_afa7c2712ee2ffc2510d24ca1cfa87d7'] = 'Oui, mais cette configuration ne peut pas être modifié après publication de votre flux sur les marketplaces. Le support Shopping Feed peut vous aider à définir la bonne stratégie.';
